import React from 'react';
import { useNavigate } from 'react-router-dom';

const MyOrderData = ({ order,i }) => {
    const { product } = order;
    const navigate = useNavigate()
    return (

             <tr>
            <th>{i+1 }</th>
              <td>
                <div className="flex items-center space-x-3">
                  <div className="avatar">
                    <div className="mask mask-squircle w-12 h-12">
                      <img
                        src={product.productImage}
                        alt={product.productName}
                      />
                    </div>
                  </div>
                  <div>
                        <div className="font-bold">
                            {product.productName}
                    </div>
                        <div className="text-sm opacity-50 font-custom2">
                            {product.categoryName}
                    </div>
                  </div>
                </div>
              </td>
              <td>
               {product.sellerName}
                <br />
                <span className="badge badge-ghost badge-sm font-custom2">
                    {product.sellerEmail}
                </span>
                <br />
                <span className="badge badge-ghost badge-sm font-custom2">
                {
                        product.sellerPhone
                    }
                </span>
              </td>
            <td>
                ${product.resalePrice}
              </td>
              <th>
                <button onClick={()=>Navi} className="btn btn-ghost btn-xs">details</button>
              </th>
              <th>
                <button className="btn btn-ghost btn-xs">details</button>
              </th>
            </tr>

    );
};

export default MyOrderData;
